@Override
public int getColumnType(int column) throws SQLException {
  switch (getColumnTypeName(column)) {
    case "String":
      return Types.VARCHAR;
    case "Integer":
      return Types.INTEGER;
    case "Long":
      return Types.DOUBLE;
    case "Double":
      return Types.DOUBLE;
    default:
      return Types.JAVA_OBJECT;
  }
}

